import React from "react";

const Navbar = () => {
  return (
    <div className="text-white flex justify-end items-center h-24 max-w[1240px] px-4">
      <h1 className="w-full text-3xl font-bold text-[#00df9a] mx-0">REACT</h1>
    </div>
  );
};

export default Navbar;
